(this["webpackJsonpdante-livingston"]=this["webpackJsonpdante-livingston"]||[]).push([[0],{50:function(e,i,t){"use strict";var a=t.p+"static/media/CorrugatedRoof_3D.8355efb2.png",o=t.p+"static/media/CorrugatedRoof.564ed9f7.png",r=t.p+"static/media/DamagedSideWalk_3D.4a994a9b.png",s=t.p+"static/media/DamagedSideWalk.e8d1f190.jpg",n=t.p+"static/media/JungleFloorTiles_3D.afe61459.png",l=t.p+"static/media/JungleFloorTiles.3a1758f9.jpg",h=t.p+"static/media/LavaFlow_3D.d87c8af4.png",d=t.p+"static/media/LavaFlow.20a11486.jpg",p=t(54),c=t.p+"static/media/MossyRocks.c9f73f2d.jpg",m=t.p+"static/media/SandyBricks_3D.8f905daa.png",g=t.p+"static/media/SandyBricks.84f5544c.png",u=t.p+"static/media/TunnelTiles_3D.86bc2d5e.png",w=t.p+"static/media/TunnelTiles.c271d7d1.png",f={slug:"digital-textures",title:"3D Textures / Assets",shortDescription:"3D photoreal texture assets I have created to be used similarly to texture assets in triple A games and movies.",description:"<p>These are a series of texture assets I have made in the program <strong><a rel='noopener noreferrer' target='_blank' href=\"https://quixel.com/mixer\">Quixel Mixer</a></strong>. Mixer is an alternative to programs like substance painter that has seen a quick and steady rise in terms of its use in triple A movie and game projects. I have always appreciated the insane detail you can find in something as simple as a broken brick wall in modern video games to the point that I had to attempt something similar myself.</p>\n\n<p>This was a personal project that really showed me that even as a single person with limited experience in 3D I could create something photo-real. It also gave me a newfound respect for the texture and environment artists that are often forgotten about as the time you can spend on a floor texture compared to how long someone will actually view it is incomparable. This project also taught me one last lesson in terms of the scope of triple A titles. While I might be able to make textures, 3D models, concept art and some other assets, there are still so many things I am completely unable to do. When working on personal projects now I have very much limited my scope to make them at least realistically doable instead of picturing a whole modern game coming out of my computer alone.</p>\n\n<p>For anyone interested in the more technical aspect of how these textures are made to look photo-real, I will explain here in a bit more detail. Each individual texture has two corresponding 3D and 2D photos, they are all made with a variety of maps including, Albedo, Diffuse, Specular, Gloss, Roughness, Normal, Displacement, AO and Metalness. These are meant to exponentially increase the texture\u2019s fidelity by providing the most realistic form of lighting, shading and texture information. The final textures are also made with a variety of photorealistic <strong><a rel='noopener noreferrer' target='_blank' href=\"https://quixel.com/megascans\">Megascans </a></strong> from Quixel\u2019s library giving them a photo-real starting point that you then take further.</p>\n\n<hr/>\n\n<p><strong>Links to Programs Used:</strong></p>\n\n<ul><li><a rel='noopener noreferrer' target='_blank' href=\"https://quixel.com/mixer\">Quixel Mixer</a></li><li><a rel='noopener noreferrer' target='_blank' href=\"https://quixel.com/bridge\">Quixel Bridge</a></li><li><a rel='noopener noreferrer' target='_blank' href=\"https://quixel.com/megascans\">Quixel Megascans</a></li><li><a rel='noopener noreferrer' target='_blank' href=\"https://www.adobe.com/products/photoshop.html\">Adobe Photoshop</a></li></ul>",type:"digital",splashImageUrl:n,images:[{url:a,title:"Corrugated Roof Texture (3D)",description:"3D texture of a Corrugated Roof Material | Made 2019",dimensions:{height:720,width:720}},{url:o,title:"Corrugated Roof Texture (2D)",description:"2D texture of a Corrugated Roof Material | Made 2019",dimensions:{height:910,width:837}},{url:r,title:"Damaged Sidewalk Texture (3D)",description:"3D texture of a Damaged Sidewalk Material | Made 2019",dimensions:{height:910,width:837}},{url:s,title:"Damaged Sidewalk Texture (2D)",description:"2D texture of a Damaged Sidewalk Material | Made 2019",dimensions:{height:1248,width:1248}},{url:n,title:"Jungle Floor Texture (3D)",description:"3D texture of a Tiled Jungle Flooring Material | Made 2019",dimensions:{height:920,width:846}},{url:l,title:"Jungle Floor Texture (2D)",description:"2D texture of a Tiled Jungle Flooring Material | Made 2019",dimensions:{height:1248,width:1248}},{url:h,title:"Lava Flow Texture (3D)",description:"3D texture of an Icelandic Lava Flow Material | Made 2019",dimensions:{height:910,width:837}},{url:d,title:"Lava Flow Texture (2D)",description:"2D texture of an Icelandic Lava Flow Material | Made 2019",dimensions:{height:1248,width:1248}},{url:p.a,title:"Mossy Rocks Texture (3D)",description:"3D texture of a Pacific Northwestern Mossy Rock Material | Made 2019",dimensions:{height:910,width:837}},{url:c,title:"Mossy Rocks Texture (2D)",description:"2D texture of a Pacific Northwestern Mossy Rock Material | Made 2019",dimensions:{height:1040,width:1040}},{url:m,title:"Sandy Bricks Texture (3D)",description:"3D texture of a Sandy Brick Material | Made 2019",dimensions:{height:910,width:837}},{url:g,title:"Sandy Bricks Texture (2D)",description:"2D texture of a Sandy Brick Material | Made 2019",dimensions:{height:760,width:760}},{url:u,title:"Tunnel Tiles Texture (3D)",description:"3D texture of a Subway Tunnel Tiles Material | Made 2019",dimensions:{height:910,width:837}},{url:w,title:"Tunnel Tiles Texture (2D)",description:"2D texture of a Subway Tunnel Tiles Material | Made 2019",dimensions:{height:720,width:720}}]},y={slug:"video-editing-project",title:"Walking Through my Home",shortDescription:"A project from my Art 75 class focussing on learning Video Editing.",description:"<p>This project was my first time working with video ever, let alone editing software. It was made originally for my Art 75 class as our introduction to using <strong><a rel='noopener noreferrer' target='_blank' href=\"https://www.adobe.com/products/premiere.html\">Adobe Premiere Pro</a></strong> as a way to test our skills after learning the basics of the software. I found this project actually very fun compared to what I imagined editing to be like and since then it has pushed me towards creating more video based art instead of just going through other mediums. The editing allowed me to creatively take a walk through my house in an abstract way which was meant to somewhat confuse the audience\u2019s sense of direction despite the architecture being very simple. I felt that especially for my first video project, this was a successful piece both in terms of the video\u2019s outcome and the things I have gained from it.</p>\n\n<hr/>\n\n<ul><li>Link to <a rel='noopener noreferrer' target='_blank' href=\"https://www.adobe.com/products/premiere.html\">Premiere Pro</a></li></ul>",type:"digital",splashImageUrl:t.p+"static/media/EditingProjThumbnailCompressedl.271a3d39.jpg",videos:[{url:"https://www.youtube.com/embed/Cw3HNFUMcss",title:"Art 75 Permiere Pro Editing Project",description:"My first project using Adobe Premiere Pro for my Art 75 class. This showcases some of the earliest things I have learned in regards to making interesting transitions and editing as a whole."}]},A={slug:"virtual-gallery",title:"My Virtual Gallery",shortDescription:"A project from my Art 74 class where I created a virtual gallery for my Pixel Art.",description:"<p>This virtual gallery was originally made in 2018 as a way to learn the software <strong><a rel='noopener noreferrer' target='_blank' href=\"https://www.sketchup.com/\">SketchUp</a></strong> and as a way to showcase my Pixel Art in the class, Art 74. While originally this piece did not have a huge amount of meaning for me other than as a learning tool, I find my stance changed now. After being quarantined to the point that I rarely go out with friends and family, going to something like a gallery is out of the question.</p>\n\n<p>With that in mind, I\u2019ve found the concept of virtual galleries more and more interesting as a way to capture the traditional experience of showing off art in a digital format. For the creation of the gallery, SketchUp was the perfect tool as a lightweight 3D modeler with free use textures and human models for scale. The pixel art was created in Sketch-Up as well and was meant to be in an Andy Warhol esque style in regards to the colors and how it was presented.</p>\n\n<hr/>\n\n<ul><li>Link to <a rel='noopener noreferrer' target='_blank' href=\"https://www.sketchup.com/\">SketchUp</a></li></ul>",type:"digital",splashImageUrl:t.p+"static/media/GalleryThumbnailCompressed.9a39010c.jpg",videos:[{url:"https://www.youtube.com/embed/rvO8PisxoFU",title:"Virtual Gallery",description:"A virtual gallery originally made for my Art 74 class, the gallery and pixel art were both made in SketchUp."}]},b=t.p+"static/media/AudioForm.6f38dfa4.jpg",k={slug:"interactive-audio-project",title:"Sounds of Work",shortDescription:"A project where you listen to audio while filling out a form.",description:"<p>This project was fairly unique for me as it involved making an interactive art piece centered on a score. I have rarely worked with interactive art other than working on real miniatures and 3D modeling which I do not have a huge amount of experience with. In regards to the music making, I had zero experience. This was absolutely a project that brought me quite a bit of growth. The audio itself is meant to be a series of sounds you might hear doing everyday \u201coffice work\u201d and were meant to be obtained all in a single room. The interactive section of the piece then comes into effect as while you are listening to the music, you will also be filling out a short form. It was intended to feel monotonous and a bit like data entry with the music in the background to further add to the effect.</p>\n\n<p>If you would like to try it yourself, I won\u2019t spoil too much and will instead leave the link to the form you can fill out while listening below.</p>\n\n<p>As for how I was able to make this, I learned the basics of <strong><a rel='noopener noreferrer' target='_blank' href=\"https://www.adobe.com/products/audition.html\">Adobe Audition</a></strong> and mixed my own recordings of a variety of \u201coffice work\u201d sounds. This was a difficult process for me as I know next to nothing when it comes to music theory, however it was still very fun to do.</p>\n\n<p>This was a group project that I completed with my fellow Art 110 Students, Elizabeth Nguyen, Sam Shi and Giovanny Lopez. I created the initial idea for the project while they all contributed \xbe of the audio clips, Elizabeth also created the form and came up with the data entry idea. I created the last quarter of the sounds as well as mixed them into the final score.</p>\n\n<hr/>\n\n<ul><li>Link to the <a rel='noopener noreferrer' target='_blank' href=\"https://docs.google.com/forms/d/e/1FAIpQLSdFSRQy_8Hgpf_C6sL0vhM9aBIjIDpgtYsIBlK6YbZfrvoFVg/viewform\">Google Form</a></li></ul>\n\n<hr/>\n\n<ul><li>Link to <a rel='noopener noreferrer' target='_blank' href=\"https://www.adobe.com/products/audition.html\">Adobe Audition</a></li></ul>",type:"digital",splashImageUrl:b,images:[{url:b,title:"Follow Along Image (Sounds of Work)",description:"This image is also on the google form that you can fill out.",dimensions:{height:740,width:611}}],audios:[{url:t.p+"static/media/Art110SoundProj_mixdown.e1692dea.mp3",title:"Sounds of Work",description:'This is the audio section of my "Sounds of Work" project. You should listen to this while filling out the google form for the best and intentded experience.'}]},K=t.p+"static/media/Dog_GlitchArt.ade272f5.PNG",v={slug:"glitch-art",title:"Glitch Art",shortDescription:"Glitch Art inspired originally by Micheal Betancourt.",description:"<p>This is a series of images that have been \u201cglitched\u201d through various programs in order to give them an abstract and technological feeling. These works were heavily inspired by <strong><a rel='noopener noreferrer' target='_blank' href=\"https://michaelbetancourt.com/\">Micheal Betancourt</a></strong>, who uses Glitch Art to emphasize the connections between media theory and practice. I wanted to create these as a way to showcase the idea of beauty in destruction, or beauty in chaos, specifically in a technological setting.</p>\n\n<p>The images were all created by importing image files into programs that do not traditionally accept them. Values were then changed and they were exported as images again to give me the glitch effect with some of the key programs used being Audacity and Premiere Pro. Having the images being visible through the glitches themselves was also intentional as a way to still illustrate the underlying, original product that I had then warped.</p>\n\n<hr/>\n\n<p><strong>Links to Programs Used:</strong></p>\n\n<ul><li><a rel='noopener noreferrer' target='_blank' href=\"https://www.audacityteam.org/\">Audacity</a></li><li><a rel='noopener noreferrer' target='_blank' href=\"https://www.adobe.com/products/premiere.html\">Adobe Premiere Pro</a></li></ul>",type:"digital",images:[{url:t.p+"static/media/Everest_GlitchArt.5efcb615.jpg",title:"Glitch art of Mount Everest",description:"Made 2018",dimensions:{height:1080,width:587}},{url:K,title:"Glitch art of a dog",description:"Made 2018",dimensions:{height:1460,width:825}},{url:t.p+"static/media/Forest_GlitchArt.e27c5707.jpg",title:"Glitch art of a Pacific Northwest Forest",description:"Made 2018",dimensions:{height:920,width:691}}]},M={slug:"photoshop-projects",title:"Photoshop Skill Projects",shortDescription:"Individual Photoshop Projects I have completed as a part of my Art 74 Class.",description:"<p>These are a few of the miscellaneous projects I have completed with <strong><a rel='noopener noreferrer' target='_blank' href=\"https://www.adobe.com/products/photoshop.html\">Adobe Photshop</a></strong>. With Photoshop being such a universal tool, these are two of my older works which each utilize different skill sets within Photoshop as a whole.</p>\n\n<p>The first is an image that has been made to look like a \u201cminiature\u201d diorama would. This effect is mainly dependent on the high depth of field and blur to give off a different perspective than the image had originally. Color adjustments were also made in order to sell the miniature vibe as many dioramas of cityscapes have much more vibrant painterly colors than they would in real life.</p>\n\n<p>The second image is originally of a snowy mountain without the snow overlay effects. This was meant as a way for me to demonstrate the control Photoshop has in that you are able to change the lighting and weather completely without disrupting the original image. The effect, much like the miniature is fairly simple with the overlay itself being a noise map with effects added on to make it more realistic. Blur, haze and tint were utilized to further sell the effect by bringing the background into line with what it would look like in a snowing setting.</p>\n\n<hr/>\n\n<ul><li>Link to <a rel='noopener noreferrer' target='_blank' href=\"https://www.adobe.com/products/photoshop.html\">Adobe Photshop</a></li></ul>",type:"digital",images:[{url:t.p+"static/media/miniature.015b51af.png",title:"Miniature Effect",description:"Made 2018",dimensions:{height:560,width:408}},{url:t.p+"static/media/snowmountain.395a7b13.jpeg",title:"Snowy Weather On Mountain Effect",description:"Made 2018",dimensions:{height:1100,width:762}}]},I={slug:"fake-crest-product",title:"Creating a Crest Product in Photoshop",shortDescription:"A redesign of the Crest box as well as a new product.",description:"<p>This was a project done through my Art 74 class where we had to make a 3D object in <strong><a rel='noopener noreferrer' target='_blank' href=\"https://www.adobe.com/products/photoshop.html\">Photoshop&#39;s</a></strong> 2D tools. It was meant to introduce us to the graphic design side of digital media art as well as expand our knowledge on how we would be able to make a rough 3D object in 2D mediums. I found it fairly interesting because of my own intrigue when it comes to graphic design as a whole. I love the idea of creating a fake product or a redesigned product as a way to ground your own ideas in the real world. This was one of my earliest Photoshop projects and I would love to go back and redesign them again with my current set of skills to see how far I have progressed.</p>\n\n<hr/>\n\n<ul><li>Link to <a rel='noopener noreferrer' target='_blank' href=\"https://www.adobe.com/products/photoshop.html\">Photoshop</a></li></ul>",type:"digital",images:[{url:t.p+"static/media/crestbox.e69b49c3.jpg",title:"3D Crest Toothpaste Box",description:"3D design of a Crest Toothpaste Box | Made 2018",dimensions:{height:800,width:800}},{url:t.p+"static/media/crestboxflavor.fe890321.jpg",title:"3D Fake Flavor Crest Toothpaste Box",description:"3D design of a Crest Toothpaste Box with an unique flavor | Made 2018",dimensions:{height:800,width:800}},{url:t.p+"static/media/crestadd.a4940777.jpg",title:"Advertisement for the Crest Toothpaste",description:"Advertisement to go along with the products | Made 2018",dimensions:{height:618,width:800}}]},j=t.p+"static/media/Adjusted3_7375.541332b3.jpg",T=t.p+"static/media/Adjusted4_7456.3ed6620e.jpg",C=t.p+"static/media/IMG_7103.196971b8.jpg",S=t.p+"static/media/IMG_7120.b9acbaa8.jpg",D=t.p+"static/media/IMG_7125.0e9eb129.jpg",_=t.p+"static/media/IMG_7131.73119e39.jpg",x=t.p+"static/media/IMG_7145.d556f109.jpg",B=t.p+"static/media/IMG_7196.4b9b6244.jpg",F=t.p+"static/media/IMG_7229.94ea0244.jpg",P=t.p+"static/media/IMG_7254.17741587.jpg",L=t.p+"static/media/IMG_7281.34fabea1.jpg",W=t.p+"static/media/IMG_7305.72f3f69e.jpg",G=t.p+"static/media/IMG_7397.0876288c.jpg",Q=t.p+"static/media/IMG_7436.8de8e072.jpg",E=t.p+"static/media/IMG_7460.31d78241.jpg",U=t.p+"static/media/Livingston_CornerOfFrame_6506.69bcba10.jpg",q=t.p+"static/media/Livingston_LeadingLines_6369.465e5a36.jpg",H=t.p+"static/media/Livingston_VisceralPrint-6812.7909ef64.jpg",R={slug:"digital-photography",title:"Digital Black and White Photography",shortDescription:"Digital Black and White photography I have done mostly consisting of nature and landscape pictures.",description:"<p>This is a series of many works of digital photography I completed as a part of my Photo 40 class. It was my first exposure to digital photography outside of just using something as simple as my phone and was a great introduction to the medium. Through digital photography I found myself able to freely express my love for nature on a different level than ever before. Whether it is going on small hikes around my house, or taking the camera out with me whenever I go camping, I\u2019ve found that there are always opportunities to take great photographs.</p>\n\n<p>I have also brought my digital photography into my digital illustration and 3D work. By utilizing my own photographs as reference, or background images for texture information I am more freely able to sidestep any potential copyright issues while still making use of the same techniques that many professional digital artists employ.</p>\n\n<p>For all of these photographs, I used a <strong><a rel='noopener noreferrer' target='_blank' href=\"https://www.usa.canon.com/internet/portal/us/home/support/details/cameras/eos-dslr-and-mirrorless-cameras/dslr/eos-rebel-t3/eos-rebel-t3\">Canon EOS Rebel T3</a></strong> with a 55mm lens. It has been extremely effective and versatile for all of my work and coupled with an editing program like Adobe Lightroom I am able to get the best results. Some of the images shown have been lightly edited, cropped and color graded, while others are raw giving them a good amount of technical range.</p>\n\n<hr/>\n\n<ul><li><p>Link to <a rel='noopener noreferrer' target='_blank' href=\"https://www.usa.canon.com/internet/portal/us/home/support/details/cameras/eos-dslr-and-mirrorless-cameras/dslr/eos-rebel-t3/eos-rebel-t3\">Canon Camera</a></p></li><li><p>Link to <a rel='noopener noreferrer' target='_blank' href=\"https://www.adobe.com/products/photoshop-lightroom.html\">Adobe Lightroom</a></p></li></ul>",type:"digital",splashImageUrl:H,images:[{url:j,title:"Multiple Large Aloe Plants",description:"Picture of some Aloe plants on a hike behind my house | Made 2019",dimensions:{height:1080,width:1620}},{url:G,title:"Single Aloe Plant",description:"Picture of a single Aloe plant on a hike behind my house | Made 2019",dimensions:{height:1440,width:960}},{url:C,title:"Nature Hike Photography",description:"Pictures from a hike behind my house | Made 2019",dimensions:{height:1080,width:720}},{url:S,title:"Nature Hike Photography with Adjustments",description:"Pictures from a hike behind my house - Adjusted Contrast | Made 2019",dimensions:{height:1080,width:720}},{url:D,title:"Nature Hike Photography Cropped",description:"Pictures from a hike behind my house - Wideangle | Made 2019",dimensions:{height:1080,width:720}},{url:_,title:"Leading Trail",description:"Pictures from a hike behind my house down a long trail | Made 2019",dimensions:{height:1080,width:720}},{url:x,title:"Single Mushroom",description:"Picture of a single mushroom from a hike behind my house | Made 2019",dimensions:{height:860,width:1290}},{url:Q,title:"Flower and Clover Field",description:"Picture of a flower and clover field from a hike behind my house | Made 2019",dimensions:{height:1156,width:771}},{url:P,title:"Dead Tree",description:"Picture of a large dead tree with beautiful branches | Made 2019",dimensions:{height:860,width:1061}},{url:B,title:"Overlook View",description:"An overlook view of my zipcode you see at the end of a hike near my house | Made 2019",dimensions:{height:860,width:1290}},{url:F,title:"Overlook View Wideangle",description:"A view of Miramar Lake which is in my neighborhood - Wideangle | Made 2019",dimensions:{height:1640,width:1093}},{url:W,title:"Lake View",description:"A view of Miramar Lake which is in my neighborhood | Made 2019",dimensions:{height:1280,width:869}},{url:E,title:"Sky Shot",description:"A picture of the sky and the wavy clouds | Made 2019",dimensions:{height:1920,width:953}},{url:T,title:"Wavy Sky Shot",description:"A picture of the sky and the wavy clouds with landscape | Made 2019",dimensions:{height:1920,width:953}},{url:L,title:"Wide Sky Shot",description:"A picture of the sky from the same overlook used for the Miramar Lake photography | Made 2019",dimensions:{height:1920,width:942}},{url:U,title:"Single Flower",description:"A single flower meant to draw the viewer's eye to the corner of the page instead of the center like usual | Made 2019",dimensions:{height:1280,width:853}},{url:q,title:"Leading Lines Road",description:"Another picture meant to draw the viewer's eye, this time down a long sidewalk | Made 2019",dimensions:{height:1280,width:853}},{url:H,title:"Night Nature Photography",description:"Some night photography with the Moon taking center stage through a dead autumn tree | Made 2019",dimensions:{height:1280,width:860}}]},J={slug:"hayao-miyazaki",title:"Hayao Miyazaki",shortDescription:"A Japanese animation and comic Icon.",description:"<p>Hayao Miyazaki is a Japanese director, writer, illustrator and animator most famously known for his position as co-founder of Studio Ghibli. I was first introduced to Miyazaki\u2019s work as a child where his storytelling and art style captivated me immediately. The beautiful, fluid animation, anti war and pro environmentalist themes resonated with me on a deep level and influence me to this day.</p>\n\n<hr/>\n\n<ul><li><p><a rel='noopener noreferrer' target='_blank' href=\"http://www.nausicaa.net/miyazaki/\">Hayao Miyazaki&#39;s Website</a></p></li><li><p><a rel='noopener noreferrer' target='_blank' href=\"https://www.instagram.com/hayaomiyazaki/?hl=en\">Hayao Miyazaki&#39;s Instagram</a></p></li><li><p><a rel='noopener noreferrer' target='_blank' href=\"https://twitter.com/hmiyazaki_news?lang=en\">Hayao Miyazaki&#39;s Twitter</a></p></li></ul>",type:"inspiration",splashImageUrl:t.p+"static/media/HayaoMiyazaki_PFP.b7cbbb8f.jpg",images:[{url:t.p+"static/media/HayaoMiyazaki_Work_01.4c3a2f44.jpg",title:"A scene from Studio Ghibli's Totoro",description:"A shot from the movie Totoro by Studio Ghibli. This is a great example of Ghibli\u2019s color use and how Miyazaki\u2019s work as a traditional watercolor artist has defined the look of his movies\u2019 backgrounds.",dimensions:{height:1132,width:634}},{url:t.p+"static/media/HayaoMiyazaki_Work_02.28ec5a87.jpg",title:"A scene from Studio Ghibli's Princess Mononoke",description:"This is a good example of the way simplicity is used in Japanese Anime. When looking at this work as a line drawing there is not a huge amount of detail or beautiful shading, however despite that the readability and composition is still better than some more detailed works.",dimensions:{height:1200,width:628}},{url:t.p+"static/media/HayaoMiyazaki_Work_03.359d6818.jpg",title:"A page from Hayao Miyazaki's Nausicaa Manga",description:"This is an example of Hayao Miyazaki\u2019s Manga (Japanese Comics) art. I love his use of value and how so much form can be shown just with the use of small sketch-like lines.",dimensions:{height:662,width:621}}]},z={slug:"aaron-blaise",title:"Aaron Blaise",shortDescription:"Aaron Blaise is an American illustrator and animator most known for his work at Disney.",description:"<p>Aaron Blaise is a creature artist who got his early break working at Disney on movies like The Lion King, Pocahontas and Mulan. He has superb animation and drawing skills, however his ability to render creatures in photoreal detail is almost more impressive to look at. His love for the outdoors is something I wholeheartedly share and the sheer range of his artwork is something I respect so much. Without knowing about him as an individual, my earliest years were undoubtedly influenced by Aaron Blaise\u2019s work on a deep level. Aaron Blaise now runs an online art school, &quot;CreatureArtTeacher&quot; as a way to share his skills and techniques with others and frequently posts free tutorials on Youtube and other platforms.</p>\n\n<hr/>\n\n<ul><li><p><a rel='noopener noreferrer' target='_blank' href=\"https://creatureartteacher.com/\">Aaron Blaise&#39;s Online Art School, Creature Art Teacher</a></p></li><li><p><a rel='noopener noreferrer' target='_blank' href=\"https://www.youtube.com/channel/UC0lLeNdvLrFozQRsQ1TQiAw\">Aaron Blaise&#39;s Youtube Channel</a></p></li><li><p><a rel='noopener noreferrer' target='_blank' href=\"https://www.artstation.com/aaronblaiseart\">Aaron Blaise&#39;s ArtStation</a></p></li><li><p><a rel='noopener noreferrer' target='_blank' href=\"https://www.instagram.com/aaronblaiseart/?hl=en\">Aaron Blaise&#39;s Instagram</a></p></li><li><p><a rel='noopener noreferrer' target='_blank' href=\"https://twitter.com/AaronBlaiseArt\">Aaron Blaise&#39;s Twitter</a></p></li></ul>",type:"inspiration",splashImageUrl:t.p+"static/media/AaronBlaise_PFP.aba8e95b.jpg",images:[{url:t.p+"static/media/AaronBlaise_Work_01.ba3aa40a.jpg",title:"Digital Lion Drawing by Aaron Blaise",description:"This is some of Aaron Blaise\u2019s digital drawing. The way his brushstrokes carefully emulate traditional work and how he uses color like traditional artists use gouache is amazing.",dimensions:{height:1200,width:969}},{url:t.p+"static/media/AaronBlaise_Work_02.6e1856ec.jpg",title:"Digital Lion Caricature by Aaron Blaise",description:"This work is more in the line of the stylized art Aaron Blaise was producing during his time at Disney. The way he renders and shows form under the fur is particularly impressive to me.",dimensions:{height:1200,width:960}},{url:t.p+"static/media/AaronBlaise_Work_03.352b9ed9.jpg",title:"Digital Eagle Drawing by Aaron Blaise",description:"Another more traditional and realistic work of Art from Aaron Blaise. The detail on the hawk\u2019s head is particularly amazing and his understanding of anatomy, as always, is perfect.",dimensions:{height:900,width:1200}}]},V={slug:"corridor-digital",title:"Corridor Digital",shortDescription:"Corridor Digital is a Youtube group who has been on the platform for ten years.",description:"<p>Corridor Digital is a group of artists who create narrative and non-narrative skits on Youtube. They have been on the platform for nearly a decade and I have been watching them for almost as long. In more recent times, their use of photoreal VFX and sophisticated editing rivals movie production companies which has always impressed me. I have always been inspired by their work ethic and tenacity in being able to stay at the top of a very turbulent platform for most of their careers.</p>\n\n<hr/>\n\n<ul><li><p><a rel='noopener noreferrer' target='_blank' href=\"https://www.corridordigital.com/join\">Corridor Digital&#39;s Website</a></p></li><li><p><a rel='noopener noreferrer' target='_blank' href=\"https://www.youtube.com/user/CorridorDigital\">Corridor Digital&#39;s Youtube Channel</a></p></li><li><p><a rel='noopener noreferrer' target='_blank' href=\"https://www.instagram.com/corridordigital/?hl=en\">Corridor Digital&#39;s Instagram</a></p></li><li><p><a rel='noopener noreferrer' target='_blank' href=\"https://twitter.com/CorridorDigital\">Corridor Digital&#39;s Twitter</a></p></li></ul>",type:"inspiration",splashImageUrl:t.p+"static/media/CorridorDigital_PFP.941256f8.jpg",images:[{url:t.p+"static/media/CorridorDigital_Work_01.20d2df63.jpg",title:"Corridor's Max Max Padory",description:"This is a scene from Corridor\u2019s Mad Max parody that really shows off their triple A production quality. The color grading, set and costume design are on par with any movie or television show despite it being a four minute comedy skit.",dimensions:{height:1920,width:1080}},{url:t.p+"static/media/CorridorDigital_Work_02.c20ec5b1.jpg",title:"Corridor's Media Mash-Up Skit",description:"A scene from one of Corridor\u2019s mash up videos where they combine characters from all over video game and movie culture. This portrays what a good amount of their early skit work was focussed on.",dimensions:{height:1920,width:1080}},{url:t.p+"static/media/CorridorDigital_Work_03.4cc32d47.jpg",title:"Corridor's 'Bosstown Dynamics' Skit",description:"This is one of Corridor\u2019s more recent projects in which they used motion capture and photoreal HDRIs and textures to create the most realistic Boston Dynamics robot they could. Their use of modern technology to get a great result despite being a company with only 7 or so VFX artists (many self taught) inspires me in regards to my own progress towards becoming a better artist. ",dimensions:{height:1200,width:630}}]},Z={slug:"feng-zhu",title:"Feng Zhu",shortDescription:"Feng Zhu is a world famous concept artist who focusses on personal projects as well as running his school, FZD School of Design.",description:"<p>Feng Zhu is a veteran concept artist who has worked on projects from Transformers to Star Wars. His designs have been seen by tens if not hundreds of millions and his design philosophy has heavily influenced my own thinking. Feng Zhu places an emphasis on understanding the fundamentals in order to ultimately create the best design possible. I have been heavily influenced by not only his art, but his way of thinking and have tried to bring much of his thought process into my own work. While he does still work on many high profile projects, he also runs an art school, the FZD School of Design which he founded in Singapore.</p>\n\n<hr/>\n\n<p>Links</p>\n\n<ul><li><p><a rel='noopener noreferrer' target='_blank' href=\"https://fzdschool.com/\">Feng Zhu School of Design</a></p></li><li><p><a rel='noopener noreferrer' target='_blank' href=\"https://www.youtube.com/user/FZDSCHOOL\">Feng Zhu&#39;s Youtube Channel</a></p></li><li><p><a rel='noopener noreferrer' target='_blank' href=\"https://www.instagram.com/fengzhudesign/?hl=en\">Feng Zhu&#39;s Instagram</a></p></li><li><p><a rel='noopener noreferrer' target='_blank' href=\"https://twitter.com/FengZhuDesign?ref_src=twsrc%5Egoogle%7Ctwcamp%5Eserp%7Ctwgr%5Eauthor\">Feng Zhu&#39;s Twitter</a></p></li></ul>",type:"inspiration",splashImageUrl:t.p+"static/media/FengZhu_PFP.4801c1e8.jpg",images:[{url:t.p+"static/media/FengZhu_Work_01.c54d1e2a.jpg",title:"Alien Concept by Feng Zhu",description:"This digital illustration is representative of most of Feng\u2019s work and shows off his unique style. His use of color and a mix of delicate and random brush strokes creates great focal points within the piece as a whole.",dimensions:{height:900,width:506}},{url:t.p+"static/media/FengZhu_Work_02.8d6c59ea.jpg",title:"Alien Ship Design by Feng Zhu",description:"Another digital illustration with lots of detail and color. In this example Feng also uses 3D to establish the basic forms of the ship as a way to demonstrate how many designs are made in the modern concept art industry.",dimensions:{height:900,width:412}},{url:t.p+"static/media/FengZhu_Work_03.84262c36.jpg",title:"Cockpit Lineart by Feng Zhu",description:"This is a lineart sketch of Feng\u2019s that really shows off his skill. The attention to detail and light use of color are able to help sell this even as a rough early draft.",dimensions:{height:1650,width:850}}]},N={slug:"jean-giraud",title:'Jean Giraud "Moebius"',shortDescription:"A French surrealist comic who has worked with Stan Lee and insipired Hayao Miyazaki.",description:"<p>Jean Giraud \u201cMoebius\u201d is a french comic artist who has worked with Stan Lee and inspired Hayao Miyazaki. His surrealist style and ability to express detail through a small use of lines sets him apart from many of his contemporaries. I have always appreciated Moebius\u2019 art and his creativity in design is something I will always be seeking to learn from. Although he died in 2012, Moebius&#39; work will be inspiring artists for years to come and still has a profound effect on many abstract and surrealist works.</p>\n\n<hr/>\n\n<ul><li><p><a rel='noopener noreferrer' target='_blank' href=\"https://www.facebook.com/JeanGiraudArt/\">Jean Giraud Moebius&#39; Facebook</a></p></li><li><p><a rel='noopener noreferrer' target='_blank' href=\"https://www.iamag.co/the-art-of-moebius/\">The Art of Moebius</a></p></li></ul>",type:"inspiration",splashImageUrl:t.p+"static/media/JeanGiraud_PFP.c1f9d15b.jpg",images:[{url:t.p+"static/media/JeanGiraud_Work_01.aaf31975.jpg",title:"Starwatcher Holding a Crystal",description:"Some of Moebius\u2019 character art that shows his ability to go from blank shapes to areas of very high detail. His use of color always impresses me and it is no exception here.",dimensions:{height:1280,width:1653}},{url:t.p+"static/media/JeanGiraud_Work_02.6484eb7b.jpg",title:"A surrealist landscape by Moebius",description:"This is some environment art done by Moebius that again expresses his ability to create beautiful line art. The color also emphasizes the line work instead of just taking place over it due to his \u201ccomic book\u201d style.",dimensions:{height:1280,width:970}},{url:t.p+"static/media/JeanGiraud_Work_03.b0914ec9.jpg",title:'A Drawing from "20 Days in the Desert"',description:"This is one of my favourite pieces done by Moebius. The insane detail coupled with a stark, empty background is perfectly representative of his style.",dimensions:{height:670,width:447}}]},X={slug:"kim-jung-gi",title:"Kim Jung Gi",shortDescription:"Kim Jung Gi is a Korean cartoonist famous for his ability to draw detailed scenes from memory.",description:"<p>Kim Jung Gi is a Korean artist and cartoonist who has worked on his own comics as well as triple A movies and games. His ability to draw intimately detailed scenes from memory is famous worldwide. I have always been in awe of his work and have been trying to incorporate some of the way he views the world and thinks into my own mindset. He currently works on individual projects for clients as well as his art group, Studio Ani.</p>\n\n<hr/>\n\n<ul><li><p><a rel='noopener noreferrer' target='_blank' href=\"https://www.kimjunggius.com/\">Kim Jung Gi&#39;s Website</a></p></li><li><p><a rel='noopener noreferrer' target='_blank' href=\"https://www.youtube.com/c/superani/videos\">Super Ani&#39;s Youtube Channel</a></p></li><li><p><a rel='noopener noreferrer' target='_blank' href=\"https://www.instagram.com/kimjunggius/?hl=en\">Kim Jung Gi&#39;s Instagram</a></p></li><li><p><a rel='noopener noreferrer' target='_blank' href=\"https://twitter.com/kimjunggius?lang=en\">Kim Jung Gi&#39;s Twitter</a></p></li></ul>",type:"inspiration",splashImageUrl:t.p+"static/media/KimJungGi_PFP.a47797d1.jpg",images:[{url:t.p+"static/media/KimJungGi_Work_01.5ed09f27.jpg",title:"Brush Drawing by Kim Jung Gi",description:"A scene of Gi\u2019s which demonstrates his mastery of the brush pen. The way the deep black smudges to create form and contrast is very well done.",dimensions:{height:1332,width:850}},{url:t.p+"static/media/KimJungGi_Work_02.536fc83c.jpg",title:"Samurai Cartoon by Kim Jung Gi",description:"This is some of Gi\u2019s work in a more cartoony style. I love the way he is able to draw amazing perspective in freehand and the detail he can show off.",dimensions:{height:1080,width:850}},{url:t.p+"static/media/KimJungGi_Work_03.860a4fe2.jpg",title:"Rally",description:"This is another scene of Gi\u2019s that really emphasizes his detailed line art. The mechanics\u2019 jumpsuits and the engines are especially inspiring to me.",dimensions:{height:1200,width:950}}]},Y=t.p+"static/media/MinimalistSpread.0b06fff3.jpg",O=t.p+"static/media/SwissArmyMinimalist_01.d20819e1.jpg",$=t.p+"static/media/SwissArmyMinimalist_02.f8268cd5.jpg",ee=t.p+"static/media/SwissArmyMinimalist_03.5721c9a2.jpg",ie=t.p+"static/media/SwissArmyMinimalist_04.2ccc1420.jpg",te={slug:"minimalism-art",title:"Minimalist / Contrast Artwork",shortDescription:"A series of peices focussing on minimalism and contrast.",description:"<p>This is a series of art focussed on minimalism and expression through heavy contrast. It was completed originally as a part of my Art 12 class, however I have taken the lessons I have learned from it much further. Being able to create a legible work entirely of black and white is something I would later express in my digital photography with the core lessons being originally taught to me with this project.</p>\n\n<p>The minimalist spread is a series of line drawings where line weight, patterns and value are emphasized. This makes each individual square unique enough to stand out, yet consistent when viewed as a whole. The other piece in this project, the <strong><a rel='noopener noreferrer' target='_blank' href=\"https://www.swissarmy.com/us/en/Products/Swiss-Army-Knives/c/SAK\">Swiss Army Knife</a></strong> was meant to imitate a generic knife and express all of it\u2019s forms within a purely black and white medium. This taught me a lot about value, form and how to express them in a purely minimalist sense. The piece also consists of a few more abstract sections of the knife that were meant to confuse you as to where they might be located on the actual object.</p>\n\n<hr/>\n\n<ul><li>Link to the <a rel='noopener noreferrer' target='_blank' href=\"https://www.swissarmy.com/us/en/Products/Swiss-Army-Knives/c/SAK\">Swiss Army Knife</a></li></ul>",type:"traditional",splashImageUrl:Y,images:[{url:Y,title:"A Spread of Minimalist Line Art",description:"Made 2019"},{url:t.p+"static/media/SwissArmyMinimalistFull.5369662d.jpg",title:"Full spread of Swiss Army Knife Works",description:"Made 2019"},{url:ie,title:"Minimalist Swiss Army Knife",description:"Made 2019"},{url:O,title:"Minimalist Swiss Army Knife's Blade",description:"Made 2019"},{url:$,title:"Minimalist Swiss Army Knife's Scooper Tool",description:"Made 2019"},{url:ee,title:"Minimalist Swiss Army Knife's Bottle Opener Tool",description:"Made 2019"}]},ae=t.p+"static/media/SharkSideView.fef35537.jpg",oe=t.p+"static/media/SharkThreeQuarterView.f663ae4c.jpg",re=t.p+"static/media/SharkThreeQuarterView_02.13e51560.jpg",se={slug:"plastic-sculpture",title:"Polluted Art",shortDescription:"A sculpture created with plastic waste and casted metal components.",description:"<p>This project consists of a single sculpture made from recyclable and self forged materials originally for my Art 13 class. It is meant to showcase the ongoing pollution of our oceans by giving you a view into a cross section of a shark filled with plastic and metal waste. I have always been a huge proponent of environmentalism and after seeing projects like <strong><a rel='noopener noreferrer' target='_blank' href=\"https://theoceancleanup.com/\">The Ocean Cleanup</a></strong> take effect I wanted to broadcast some of my own perspectives through my art.</p>\n\n<p>The work itself was made as said above, entirely of recyclable materials like plastic bags and an old shark toy. The small metal cans and bottles were made in a way completely new to me. We were able to cast them ourselves in a crucible after making plaster molds in which to form them. This was a super interesting and fun experience for me especially since I have no idea when the next time I will be able to do metal casting will be.</p>\n\n<hr/>\n\n<ul><li>Link to <a rel='noopener noreferrer' target='_blank' href=\"https://theoceancleanup.com/\">The Ocean Cleanup</a></li></ul>",type:"traditional",splashImageUrl:re,images:[{url:ae,title:"Shark Sculpture Side View",description:"Made 2019"},{url:oe,title:"Shark Sculpture Three Quarters View",description:"Made 2019"},{url:re,title:"Shark Sculpture Alternate Three Quarters View",description:"Made 2019"},{url:t.p+"static/media/SharkTopView.972b9aa8.jpg",title:"Shark Sculpture Top View",description:"Made 2019"}]},ne=t.p+"static/media/InkDrawing_01.4dd1d1d2.jpg",le={slug:"ink-drawing",title:"Traditional Ink Drawings",shortDescription:"Nature studies done traditionally with a bamboo quill and ink.",description:"<p>This was a project originally composed for my Art 24 class. It was my first time drawing with a quill and actual ink so it was a fun learning process. We utilized <strong><a rel='noopener noreferrer' target='_blank' href=\"https://www.amazon.com/Jack-Richeson-Strong-Bamboo-medium/dp/B0042ST57A\">bamboo reed pens</a></strong> and <strong><a rel='noopener noreferrer' target='_blank' href=\"https://www.amazon.com/Speedball-2-Ounce-India-Super-Black/dp/B0007ZJ8TM\">India Ink</a></strong> to make the art which were both much easier to use than I originally imagined. The works themselves are all fundamentally studies of black and white composition, value and form of plants in vases that you would traditionally see in any drawing class. I found the ink blotching frustrating to deal with at first, however later I saw it as another way to express the uniqueness of the medium itself and began to try and take advantage of it in some pieces. I am a huge fan of the ink aesthetic and drawing traditionally, so this was very fun to work on as well as being informative.</p>\n\n<hr/>\n\n<ul><li><p>Link to <a rel='noopener noreferrer' target='_blank' href=\"https://www.amazon.com/Jack-Richeson-Strong-Bamboo-medium/dp/B0042ST57A\">Bamboo Reed Pens</a></p></li><li><p>Link to <a rel='noopener noreferrer' target='_blank' href=\"https://www.amazon.com/Speedball-2-Ounce-India-Super-Black/dp/B0007ZJ8TM\">India Ink</a></p></li></ul>",type:"traditional",splashImageUrl:ne,images:[{url:ne,title:"Ink Drawing of Contrast",description:"Made 2019"},{url:t.p+"static/media/InkDrawing_02.6bf58ddc.jpg",title:"Ink Drawing of Negative Space",description:"Made 2019"},{url:t.p+"static/media/InkDrawing_03.28d6ee24.jpg",title:"Second Ink Drawing of Negative Space",description:"Made 2019"},{url:t.p+"static/media/InkDrawing_04.c9a8b1a6.jpg",title:"Ink Drawing of Vines",description:"Made 2019"},{url:t.p+"static/media/InkDrawing_05.d0ed22a2.jpg",title:"Ink Drawing of Blotchy Leaves",description:"Made 2019"},{url:t.p+"static/media/InkDrawing_06.fd91b2e0.jpg",title:"Ink Drawing of Branches",description:"Made 2019"},{url:t.p+"static/media/InkDrawing_07.40ee2977.jpg",title:"Ink Drawing of Large Leaves",description:"Made 2019"}]},he=t.p+"static/media/FanFrontView.224a3121.jpg",de=t.p+"static/media/FanSideView.513b1271.jpg",pe=t.p+"static/media/FanThreeQuartersView.e7d62ae3.jpg",ce=t(55),me="data:image/jpeg;base64,",ge=[f,v,M,R,I,y,k,A,J,z,V,Z,N,X,te,se,le,{slug:"wire-sculpture",title:"Wire Sculptures",shortDescription:"A series of two sculptures made entirely of wire.",description:"<p>This is a series of two wire sculptures I originally made as a part of my Art 13 class. They are unique in that they are my first foray into sculpture in entirety unless you count dioramas and miniatures. The sculptures were meant to showcase that even when making something with the bare minimum in terms of materials, you could still create something unique and detailed.</p>\n\n<p>The first sculpture was a simple wire ball to get us familiar with the tools and medium and was meant as a stepping stone to our later sculpture. I found this pretty fun to make overall as it gave me the opportunity to work with my hands which I had been doing less and less as the digital side of my college career was taking up more of my time.</p>\n\n<p>The second sculpture is a replica of a small desktop fan I have and it was originally able to stand up on it\u2019s own. However due to having it move across the state it is a little worse for wear. This piece was very challenging to me, as the wire was fairly greasy and the smaller gauge was especially hard to manipulate because of this. Ultimately, the sculpture came out well in the end and really showed off the form of the fan almost exactly to what the original was.</p>\n\n<hr/>",type:"traditional",splashImageUrl:ce.a,images:[{url:ce.a,title:"Wire Ball Sculpture",description:"This is the original wire ball sculpture I created and was meant as a testing ground to understand the medium. | Made 2019"},{url:he,title:"Fan Sculpture Front View",description:"Front view of the main fan sculpture I have created. | Made 2019"},{url:de,title:"Fan Sculpture Side View",description:"Side view of the main fan sculpture I have created. | Made 2019"},{url:pe,title:"Fan Sculpture Three Quarters View",description:"Three quarters view of the main fan sculpture I have created, this image shows off depth and form well. | Made 2019"}]},{slug:"tools",title:"Tools",shortDescription:"These are some of my favorite tools",description:"<h1>H1 Header</h1>\n\n<h2>H2</h2>\n\n<h3>H3</h3>\n\n<p>I am <strong>bold</strong> text</p>\n\n<p>I am <em>italicized</em> text</p>\n\n<blockquote><p>I am block quote</p></blockquote>\n\n<ol><li>first</li><li>second</li><li><p>third</p></li><li><p>first</p></li><li>second</li><li>third</li></ol>\n\n<p><code>i am code</code></p>\n\n<p>Horizontal rule below</p>\n\n<hr/>\n\n<p>Link to <a rel='noopener noreferrer' target='_blank' href=\"http://www.google.com\">Google</a></p>",type:"tools",splashImageUrl:me,images:[{url:t.p+"static/media/big-red-image.e6e69f84.jpg",title:"Photoshop",description:"lorem ipsum foobar magna vulputate"},{url:me,title:"iPad",description:"lorem ipsum foobar ridiculus mus"},{url:"data:image/png;base64,",title:"quisque ut",description:"lorem ipsum foobar quisque ut"}]}];i.a=ge},54:function(e,i,t){"use strict";i.a=t.p+"static/media/MossyRocks_3D.56c9ab78.png"},55:function(e,i,t){"use strict";i.a=t.p+"static/media/WireBall.5a14256b.jpg"}}]);
